const initialState = {
    allTrips:[],
}

const gsetTrips = (state = initialState, action) => {
    switch(action.type){
        case "SET_TRIP":
            return {...state, allTrips: action.payload.trips}

        default:
            return state
    }
}

const tripsDetails = (state = initialState, action) => {
    switch(action.type){
        case "TRIP_DETAILS":
            return {...state, allTrips: action.payload.trips}

        default:
            return state
    }
}
